description:
Growing Up Is Getting Old is the second studio album by American country music singer Jason Michael Carroll. It will be released on April 28, 2009 via Arista Nashville. Its lead-off single, &quot;Where I'm From&quot; has charted in the Top 40 on the Hot Country Songs chart.

Quality: 320kbps

Track listing

1. &quot;Happened on a Saturday Night (Susie Q)&quot;
2. &quot;Let Me Go&quot;
3. &quot;Where I'm From&quot; (Patrick Davis, Joe Leathers) - 4:35
4. &quot;Tears&quot;
5. &quot;Growing Up Is Getting Old&quot;
6. &quot;That's All I Know&quot;
7. &quot;We Threw It All Away&quot;
8. &quot;Sorry Don't Matter&quot;
9. &quot;Barn Burner&quot;
10. &quot;Hurry Home&quot;

